import toto from "./../assets/maison1"

function Pictures({ pictures }) {
    console.log(pictures)
    return (
        <div>
            {
                
                pictures.map(picture => (<div className="images" key={picture.name}>
                
                    <img src={toto} alt="Maison 1" />

                </div>)
                )
            }


        </div>
    )
}

export default Pictures;
